import React from 'react';
import { v1 } from 'uuid';
import './App.css';
import { ToDoList } from './ToDoList';

//первое занятие- разбираемся как 

let tasks1 = [
    {
        task: 'js',
        id: v1(),
        description:'something',
        checked:true,
    },
    { task: 'sccs' ,
    id: v1(),
    description:'something',
    checked:true,
},
    { task: 'html',
    id: v1(),
    description:'something',
    checked: false, },
]

let tasks2 = [
    {
        task: 'js',
        id: v1(),
        description:'something',
        checked:true,
    },
    { task: 'sccs' ,
    id: v1(),
    description:'something',
    checked:true,
},
    { task: 'html',
    id: v1(),
    description:'something',
    checked: false, },
]

function App() {
    return (
        <div className="App">
            <ToDoList title='watch' tasks={tasks1} />
            <ToDoList title='learn' tasks={tasks2} />
        </div>
    );
}


export default App;
